import React from 'react';
import classes from './Variable_main.module.css';
import {NavLink} from "react-router-dom";
const Variable_main=(props)=>{
        let navigationElement = props.Express_main.map(nav => (

            <div className={'col-auto d-none d-lg-block mt-2' + ' ' + classes.indexBlockMain}>
                        <NavLink className="section-menu" to={nav.id} activeClassName={classes.active}>
                            <p className="index_order_text_header index_order_text_header-active">
                                {nav.title}
                            </p>
                        </NavLink>
                    </div>))
        return <div className={'row' + ' ' + classes.blockMain}>
                        <p>{navigationElement}</p>
                    </div>
        };
export default Variable_main;



